import { Button, CircularProgress, Switch } from '@mui/material'
import { useNavigate } from 'react-router-dom'

import { TeahouseFilterModel } from '@/apis/teahouse/getTeahouseFilters'
import useTeahouseFilters from '@/hooks/teahouse/useTeahouseFilters'

const TeahouseFilterPage = () => {
  const navigate = useNavigate()
  const { data: filters, isLoading } = useTeahouseFilters()
  console.log(filters)
  return (
    <div style={{ display: 'flex', flexDirection: 'column', alignItems: 'center' }}>
      <h1>찻집 필터 페이지</h1>
      <Button onClick={() => navigate('create')}>필터 만들기</Button>
      <h1>현재 필터</h1>
      {(isLoading) && <CircularProgress />}
      <div>
        {(filters) && filters.map((filter) => (<TeahouseFilter
          key={filter.id}
          filter={filter} />))}
      </div>
    </div>
  )
}
export default TeahouseFilterPage

type TeahouseFilterProps = { filter: TeahouseFilterModel }
const TeahouseFilter = ({ filter }: TeahouseFilterProps) => {
  return (
    <div style={{ display: 'flex', flexDirection: 'row', alignItems: 'center', gap: '10px' }}>
      <div>{filter.id}</div>
      <div>{filter.category}</div>
      <div>{filter.title}</div>
      <Switch checked={filter.show} />
    </div>
  )
}
